const moment = require('moment');
const ms = require('ms')
exports.run = async (client, message) => {
var time = moment().format('Do MMMM YYYY , hh:mm');
var room;
var title;
var duration;
var currentTime = new Date(),
hours = currentTime.getHours() + 3 ,
minutes = currentTime.getMinutes(),
done = currentTime.getMinutes() + duration,
seconds = currentTime.getSeconds();
if (minutes < 10) {
minutes = "0" + minutes;
}
var suffix = "AM";
if (hours >= 12) {
suffix = "PM";
hours = hours - 12;
}
if (hours == 0) {
hours = 12;
}
var filter = m => m.author.id === message.author.id;

if(!message.member.hasPermissions("ADMINISTRATOR")) return message.channel.send(
    new Discord.RichEmbed() 
.setColor('RED')
.setTitle('Hata :x:')
.setDescription('Bu komutu kullana bilmek için `YÖNETİCİ` yetkisine sahip olmalısın!'))
     message.channel.send(`Çekilişi Yapmak İstediğin Kanalın Adını Yaz!


** Örnek : çekiliş** Böylece Çekiliş Kanalını Belirtmeiş Olursun Ve Alt Alta Yaz!
`).then(msg => {
      message.channel.awaitMessages(filter, {
        max: 1,
        time: 20000,
        errors: ['time']
      }).then(collected => {
        let room = message.guild.channels.find(x => x.name ===  collected.first().content);
        if(!room) return message.channel.send('Kanalı Bulamadım!');
        room = collected.first().content;
